import React from "react";
import logo from "../pages/Sanjivani.png";
import styled from "styled-components";
import { useState } from "react";
import "react-slideshow-image/dist/styles.css";
import { Slide } from "react-slideshow-image";

import {
  MDBCollapse,
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavbarItem,
  MDBNavbarLink,
  MDBNavbarToggler,
  MDBContainer,
  MDBIcon,
} from "mdb-react-ui-kit";

export default function Navbar() {
  const [showBasic, setShowBasic] = useState(false);
  return (
    <div>
      <MDBNavbar
        style={{ backgroundColor: "white" }}
        className="nav"
        expand="lg"
        light
        bgColor="#5AB9EA"
      >
        <MDBContainer fluid>
          <img
            src={logo}
            style={{ height: "50px", width: "65px", padding: "5px" }}
          />

          <MDBNavbarBrand
            style={{
              paddingLeft: "10px",
              fontFamily: "Nexa",
              fontSize: "30px",
            }}
            href="/landing"
          >
            Mechtrix Consultants
          </MDBNavbarBrand>

          <MDBNavbarToggler
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
            onClick={() => setShowBasic(!showBasic)}
          >
            <MDBIcon icon="bars" fas />
          </MDBNavbarToggler>

          <MDBCollapse navbar show={showBasic}>
            <MDBNavbarNav className="mr-auto mb-2 mb-lg-0">
              <MDBNavbarItem
                style={{
                  fontFamily: "Nexa-Light",
                  fontSize: "20px",
                  padding: "18px",
                  fontWeight: "bold",
                }}
              >
                <MDBNavbarLink active aria-current="page" href="/fab-lab">
                  Fab Lab
                </MDBNavbarLink>
              </MDBNavbarItem>
              <MDBNavbarItem
                style={{
                  fontFamily: "Nexa-Light",
                  fontSize: "20px",
                  padding: "18px",
                  fontWeight: "bold",
                }}
              >
                <MDBNavbarLink active aria-current="page" href="/industry-4-0">
                  Industry 4.0
                </MDBNavbarLink>
              </MDBNavbarItem>
              <MDBNavbarItem
                style={{
                  fontFamily: "Nexa-Light",
                  fontSize: "20px",
                  padding: "18px",
                  fontWeight: "bold",
                }}
              >
                <MDBNavbarLink active aria-current="page" href="/automation">
                  Automation
                </MDBNavbarLink>
              </MDBNavbarItem>
              <MDBNavbarItem
                style={{
                  fontFamily: "Nexa-Light",
                  fontSize: "20px",
                  padding: "18px",
                  fontWeight: "bold",
                }}
              >
                <MDBNavbarLink active aria-current="page" href="/software">
                  Software
                </MDBNavbarLink>
              </MDBNavbarItem>
              <MDBNavbarItem
                style={{
                  fontFamily: "Nexa-Light",
                  fontSize: "20px",
                  padding: "18px",
                  fontWeight: "bold",
                }}
              >
                <MDBNavbarLink active aria-current="page" href="/landing">
                  About us
                </MDBNavbarLink>
              </MDBNavbarItem>
            </MDBNavbarNav>
          </MDBCollapse>
        </MDBContainer>
      </MDBNavbar>
    </div>
  );
}
